export default class extends Component {
    constructor(props) {
        super(props);
        this.state = {
            products: [],
        };
    }


    render() {
        const { products } = this.state;

        return (
            <div>
                <Header />
                <TableBasic {...props.p} />
            </div>
        );
    }
}
